import React from "react";

const Home = () => {
  return (
    <div className="mt-5">
      <h1 className="text-center mb-5">HOME</h1>

      <div>
        <p>
          未ログインじに表示されるアプリのホーム画面です。編集画面にアクセスするためにはログインが必要です。
        </p>
        <p>
          ログインせずに左側ナビゲーションバーの「カルテ情報」「フレーム情報」をクリックすると、ログイン画面(Auth0)にリダイレクトされます。
        </p>
        <p>
          事前に登録されているアカウントのみログインできます。（アプリからの新たなサインアップ不可）
        </p>
      </div>
    </div>
  );
};

export default Home;
